itindaklanjuti atau dianggap tidak sah.\r\n*kecuali: memang ada kesalahan\r\n3. Jika kerusakan packaging hanya pada bagian luar (bagian dalam utuh, produk tidak ada kerusakan/kekurangan, dll) disebabkan penanganan paket dari Pihak Jasa Ekspedisi yang kurang baik.',	139.00,	NULL,	'DIGI269',	'instock',	0,	151,	'digital_11.jpg',	NULL,	4,	'2023-01-01 12:16:39',	'2023-01-01 12:16:39'),
